import React from 'react';
import './Blogs.css';

const blogs = [
    {
        title: 'Top 5 Benefits of Deep Cleaning',
        image: 'https://via.placeholder.com/400',
        description: 'Deep cleaning can transform your home or office, improving health and well-being. Discover the top 5 benefits of deep cleaning.'
    },
    {
        title: 'How to Choose the Right Cleaning Service',
        image: 'https://via.placeholder.com/400',
        description: 'Choosing the right cleaning service can be tricky. Here are some tips to make the right choice for your space.'
    },
    {
        title: 'Why Regular Deep Cleaning is Important',
        image: 'https://via.placeholder.com/400',
        description: 'Regular deep cleaning is essential for maintaining a healthy environment. Learn why it matters for your home and workplace.'
    },
    {
        title: 'Best Cleaning Hacks for a Sparkling Home',
        image: 'https://via.placeholder.com/400',
        description: 'Discover some of the best cleaning hacks to keep your home looking spotless and fresh all year round.'
    },
    {
        title: 'How to Prepare for a Professional Deep Clean',
        image: 'https://via.placeholder.com/400',
        description: 'Getting ready for a professional deep clean? Here are some tips to make the most of your service.'
    },
    {
        title: 'Top 10 Myths About Deep Cleaning',
        image: 'https://via.placeholder.com/400',
        description: 'Debunking the most common myths about deep cleaning to help you make informed decisions.'
    }
];

const BlogsComponent = () => {
    return (
        <div className="blogs-container container py-5">
            <h2 className="text-center mb-5">Latest Blogs</h2>
            <div className="row">
                {blogs.map((blog, index) => (
                    <div key={index} className="col-md-4 mb-4">
                        <div className="card shadow-sm rounded-4">
                            <img src={blog.image} alt={blog.title} className="card-img-top rounded-top-4" />
                            <div className="card-body">
                                <h5 className="card-title">{blog.title}</h5>
                                <p className="card-text">{blog.description}</p>
                                <button className="btn btn-primary">Read More</button>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default BlogsComponent;
